import React from 'react';

function LeftMenu() {
  return (
    <div className="sidebar">
      <ul className="list-unstyled">
        <li><a href="/perfil">Mi Perfil</a></li>
        <li><a href="/publicaciones">Mis Publicaciones</a></li>
        <li><a href="/cambiar-contrasena">Cambiar Contraseña</a></li>
        <li><a href="/mis-favoritos">Mis Favoritos</a></li>
        <li><a href="/mis-amigos">Mis Amigos</a></li>
        <li><a href="/configuracion-privacidad">Configuración de Privacidad</a></li>
        <li><a href="/ayuda">Ayuda/Soporte</a></li>
        <li><a href="/acerca-de">Acerca de</a></li>
      </ul>
    </div>
  );
}

export default LeftMenu;
